import React from 'react';

import { TableCell as TableCellMui } from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({
    table_row: {
        border: '1px solid #E3E6EC',
    },

    secondary_text: {
        color: '#908f8f',
    },
});

interface TableCellProps {
    text?: string;
    secondaryText?: string;
}

function TableCell({ text, secondaryText }: TableCellProps): React.ReactElement {
    const classes = useStyles();
    return <TableCellMui className={classes.table_row}>
        <p>{text}</p>
        <p className={classes.secondary_text}>{secondaryText}</p>
    </TableCellMui>
}

export default TableCell
